/********************************/
/*  Insert User Tasks & AuthWC  */
/********************************/
-- find login_id
-- change login_id in the where statement of Set Variables section
-- you can then run the remainder of the script from declare to the end

/********************************/
/*  Set Variables               */
/********************************/

declare @id char(9), @morg varchar(3)
select @id = ssn from du05_personnel where login_id like 'jhernan'
select @morg = aimd_org from da03_site

/********************************/
/*  Delete Previous tasks       */
/********************************/

delete from du10_person_task where ssn like @id
delete from du03_authwc where ssn like @id


/********************************/
/*  Insert User Tasks	        */
/********************************/


/********************************/
/*  Insert AuthWC Tasks	        */
/********************************/




/********************************/
/*  Clean-up Table (Invalid WC) */
/********************************/
delete from du03_authwc where ssn like @id and wc_cd not in (select distinct wc_cd from da05_workcenter where org_cd like (select aimd_org from da03_site))
go
